import React from 'react';
import axios from 'axios';


class World extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      datas: [],
    }

    const request = axios.create({
      baseURL: 'https://coronavirus-19-api.herokuapp.com'
    })
    request.get('/all')
    .then(res => {
      this.setState({
        datas: res.data,
      });
    })
  }

  render() {
    return (
      <div>
        {this.state.datas}
      </div>
    );
  }
}

export default World;
